import React from "react";

function Footer() {
  return (
    <footer id="sticky-footer" className="py-4  text-black-50 fixed-bottom">
      <div className="container text-center">
        <small>BLUXURY CATERING &copy; 2020 Cooper Yeh</small>
      </div>
    </footer>
  );
}

export default Footer;
